import { BrowserRouter } from 'react-router-dom';
import './App.css';
import { Footer } from './footer/footer';
import { Header } from './header/header';
import { Main } from './main page/main';
import { Portfolio } from './portfolio/portfolio';

function App() {
  return (
    <div className="App">
        <Header/>
        <BrowserRouter>
        <Route path='/main/'>
        <Main/>
        </Route>
        {/* <Portfolio/> */}
        </BrowserRouter>
        <Footer/>
    </div>
  );
}

export default App;
